import React from "react";
import './Logo.css';
import Tilt from 'react-parallax-tilt';
import Logo from './brainIcon.svg';

const Navigation = () => {
    return (
    <Tilt className="flex ma2 pa2" style={{ height: '150px', width: '150px'}}>
        <div className="flex br2 shadow-2" style={{ }}>
            <img alt="logo" src={Logo} />
        </div>
    </Tilt>
    );
}

export default Navigation;
